import { NavLink } from "react-router-dom";
import interior1 from "../../assets/images/interior/1.jpg";
import interior2 from "../../assets/images/interior/2.webp";
import interior3 from "../../assets/images/interior/3.jpg";
import Carousel from "../UI/Carousel/Carousel";
import { FollowBtn } from "../UI/followBtn/FoollowBtn";
import { MENU_PATH } from "../../consts/consts";

const Main_Page = () => {
  return (
    <>
      <Carousel />
      <div className="main__page">
        <div className="restoranName">
          <div className="container">
            <p className="restoran">Choko</p>
            <p className="type">Ресторан</p>
          </div>
        </div>
        <div className="p">
          <p>MENU</p>
        </div>
        <div className="container">
          <div className="points">
            <NavLink to="/menu" className="point"><p>Піцца</p><FollowBtn /></NavLink>
            <NavLink to="/menu" className="point"><p>Соки</p><FollowBtn /></NavLink>
            <NavLink to="/menu" className="point"><p>Коктейлі</p><FollowBtn /></NavLink>
            <NavLink to="/menu" className="point"><p>Алкоголь</p><FollowBtn /></NavLink>
            <NavLink to="/menu" className="point"><p>Вина</p><FollowBtn /></NavLink>
            <NavLink to="/menu" className="point"><p>Бар</p><FollowBtn /></NavLink>
          </div>
        </div>
      </div>
    </>
  );
};

export default Main_Page;
